import { Link } from 'react-router-dom';
import styles from '../styles/Projects.module.css';

function Projects() {
  const projects = [
    {
      id: 1,
      name: 'Project 1',
      description: 'This is a description of Project 1.',
      image: '../assets/download.png'
    },
    {
      id: 2,
      name: 'Project 2',
      description: 'This is a description of Project 2.',
      image: '../assets/download.png'
    },
    {
      id: 3,
      name: 'Project 3',
      description: 'This is a description of Project 3.',
      image: '../assets/download.png'
    },
    {
      id: 4,
      name: 'Project 4',
      description: 'This is a description of Project 4.',
      image: '../assets/download.png'
    },
    {
      id: 5,
      name: 'Project 5',
      description: 'This is a description of Project 5.',
      image: '../assets/download.png'
    },
    {
      id: 6,
      name: 'Project 6',
      description: 'This is a description of Project 6.',
      image: '../assets/download.png'
    },

  ];
  return (
    <div className={styles.projects}>
      {projects.map((project, i) => (
        <div className={styles.projectContainer} key={i}>
          {i === 0 && <div className={styles.spacer}></div>}
          <Link to={`/project/${project.id}`} className={styles.projectLink}>
            <div className={styles.project}>
              <div className={styles.projectImage} style={{ backgroundImage: `url(${project.image})` }} />
              <h2 className={styles.projectTitle}>{project.name}</h2>
              <p className={styles.projectDescription}>{project.description}</p>
            </div>
          </Link>
        </div>
      ))}
    </div>
  );
}

export default Projects;
